import { Box, Stack, Typography } from "@mui/material";
import Navbar from "../../components/Navbar.jsx";
import WebGazer from './WebGazer';
import SpeechReader from "./SpeechReader";
import Avatar from "./Avatar.jsx";
import SpeechToText from "./SpeechToText.jsx"

function Interview() {

  return(
    <div>
      <Stack direction="column" spacing={3} width='100vw'>
        <Box sx={{ backgroundColor: "rgba(4,198,223,0.4)", height: "73px"}}>
          <Navbar />
        </Box>

        <Box sx={{ backgroundColor: "rgba(4,198,223,0.4)", height: "720px", width: "400px", align: "center"}}>
          <Avatar />
        </Box>

        <Box sx={{ backgroundColor: "rgba(4,198,223,0.4)", height: "100px"}}>
          <SpeechToText />
        </Box>
      </Stack>
    </div>
  );
};

export default Interview;
